var MyStore = new function() {
  this.put = function(key, value) {
    try {
      localStorage.setItem(key, value);
    } catch(e) {
      console.log(e);
    }
  };

  this.get = function(key, callback) {
    try {
      var result = localStorage.getItem(key);
    } catch(e) {
      console.log(e);
    }
    if (callback)
      callback(result);
    else
      return result;
  };

  this.remove = function(key) {
    try {
      localStorage.removeItem(key);
    } catch(e) {
      console.log(e);
    }
  };

  this.clear = function() {
    try {
      localStorage.clear();
    } catch(e) {
      console.log(e);
    }
  };
};
